//SPDX-License-Identifier: MIT

pragma solidity ^0.8.20;

import {MockUsdt} from "./MockUsdt.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Address.sol";

contract MiniLend {
    MockUsdt public mockusdt;
    using Address for address payable;

    error BorrowLimitExceeded(uint256 amount, uint256 availableToBorrow);
    error OverPaymentNotSupported(uint256 amountPaid, uint256 expectedAmount);
    error BorrowedAmountNotFullyRepaid(uint256 balance);
    error NotEnoughCollateral(uint256 collateralBalance, uint256 userInput);
    error InvalidAddress(address addr);
    error NoCollateralProvided();
    error InvalidAmount();
    error NoUsdtBorrowed();

    event EthStaked(address indexed user, uint256 ethAmount);
    event USDRepaid(address indexed user, uint256 usdAmount);
    event USDBorrowed(address indexed user, uint256 usdAmount);
    event ETHCollateralWithdrawn(address indexed user, uint256 amount);

    struct User {
        uint256 stakedEth;
        uint256 borrowedUsdt;
    }

    mapping(address => User) public users;
    uint256 private constant LTV = 50;
    uint256 private constant WAD = 1e18;
    uint256 private constant PCT_DENOMINATOR = 100;
    uint256 private constant ETH_PRICE_IN_USD = 2000e18;
    uint256 private constant LIQUIDATION_THRESHOLD = 75;

    constructor(address _mockusdtAddress) {
        if (_mockusdtAddress != address(0)) {
            mockusdt = MockUsdt(_mockusdtAddress);
        } else {
            revert InvalidAddress(_mockusdtAddress);
        }
    }

    /* ============ Receive / Fallback ============ */
    receive() external payable {}

    fallback() external payable {}

    function getContractUsdBal() public view returns (uint256) {
        return mockusdt.balanceOf(address(this));
    }

    function getContractEthBal() public view returns (uint256) {
        return address(this).balance;
    }

    function stakeEth() public payable {
        if (msg.value > 0) {
            users[msg.sender].stakedEth += msg.value;
        } else {
            revert NoCollateralProvided();
        }

        emit EthStaked(msg.sender, msg.value);
    }

    function borrowUsd(uint256 amount) external {
        User storage user = users[msg.sender];

        if (user.stakedEth == 0) revert NoCollateralProvided();
        if (amount == 0) revert InvalidAmount();

        // calculate max borrow
        if (howMuchYouCanStillBorrow(msg.sender) > 0) {
            user.borrowedUsdt += amount;
        } else {
            revert("You have exceeded your borrow limit");
        }
        // uint256 maxBorrow = ((user.stakedEth * ETH_PRICE_IN_USD * LTV) /
        //     (PCT_DENOMINATOR * WAD));

        // // check borrow limit
        // uint256 availableToBorrow = maxBorrow - user.borrowedUsdt;
        // if (amount > availableToBorrow) {
        //     revert BorrowLimitExceeded(amount, availableToBorrow);
        // }

        // update state
        user.borrowedUsdt += amount;

        // Transfer logic
        _ensureFundsAndTransfer(msg.sender, amount);

        emit USDBorrowed(msg.sender, amount);
    }

    function repayUsd(uint256 amount) public {
        User storage user = users[msg.sender];
        if (amount == 0 || user.borrowedUsdt == 0) revert NoUsdtBorrowed();

        if (amount <= user.borrowedUsdt) {
            // mockusdt.approve(address(this), amount);
            require(
                mockusdt.transferFrom(msg.sender, address(this), amount),
                "Transfer Failed"
            );
        } else {
            revert OverPaymentNotSupported(amount, user.borrowedUsdt);
        }

        user.borrowedUsdt -= amount;

        emit USDRepaid(msg.sender, amount);
    }

    // collateral can be withdrawn only when borrowed usdt is fully repaid
    function withdrawCollateralEth(uint256 amount) public {
        User storage user = users[msg.sender];
        if (amount == 0 || user.borrowedUsdt != 0)
            revert BorrowedAmountNotFullyRepaid(user.borrowedUsdt);
        if (amount > user.stakedEth)
            revert NotEnoughCollateral(user.stakedEth, amount);

        // update state
        user.stakedEth -= amount;
        //payable(msg.sender).transfer(amount);

        // Transfer ETH
        (bool success, ) = address(msg.sender).call{value: amount}("");
        require(success, "ETH transfer failed");

        emit ETHCollateralWithdrawn(msg.sender, amount);
    }

    // ============ Internal Functions ============

    function _ensureFundsAndTransfer(address to, uint256 amount) internal {
        uint256 contractBalance = getContractUsdBal();

        if (contractBalance >= amount) {
            require(mockusdt.transfer(to, amount), "Transfer failed");
        } else {
            uint256 shortfall = amount - contractBalance;
            if (contractBalance > 0) {
                require(
                    mockusdt.transfer(to, contractBalance),
                    "Transfer failed"
                );
            }
            mockusdt.mint(to, shortfall);
        }
    }

    function howMuchYouCanStillBorrow(
        address user
    ) internal view returns (uint256) {
        uint256 maxBorrow = ((users[user].stakedEth * ETH_PRICE_IN_USD * LTV) /
            (PCT_DENOMINATOR * WAD * WAD));
        if (((users[user].borrowedUsdt) / WAD) >= maxBorrow) return 0;
        uint256 availableToBorrow = maxBorrow -
            ((users[user].borrowedUsdt) / WAD);
        return (availableToBorrow);
    }
}

